🚨 NEWS 🚨
@rimac_automobili to take control of @bugatti - According to Financial Times the new company will be called “Bugatti Rimac” and will be led by Mate Rimac. It is sad to say that we are waving goodbye to the legendary 8L W16 engine, but the industry has spoken - electricity is the chosen path. #bigtoys
C: @tfjj
